pub fn take_characters_0(s: String, k: i32) -> i32 {
    fn foo(s: &str, a: i32, b: i32, c: i32) -> i32 {
        if a == 0 && b == 0 && c == 0 {
            0
        } else {
            if s.is_empty() {
                return -1;
            }
            let mut ans = 100050;
            let t = match s.as_bytes()[0] as char {
                'a' => foo(&s[1..], std::cmp::max(a - 1, 0), b, c),
                'b' => foo(&s[1..], a, std::cmp::max(b - 1, 0), c),
                'c' => foo(&s[1..], a, b, std::cmp::max(c - 1, 0)),
                _ => panic!(),
            };
            if t != -1 {
                ans = std::cmp::min(ans, t + 1);
            }

            let t = match s.as_bytes()[s.len() - 1] as char {
                'a' => foo(&s[..s.len() - 1], std::cmp::max(a - 1, 0), b, c),
                'b' => foo(&s[..s.len() - 1], a, std::cmp::max(b - 1, 0), c),
                'c' => foo(&s[..s.len() - 1], a, b, std::cmp::max(c - 1, 0)),
                _ => panic!(),
            };
            if t != -1 {
                ans = std::cmp::min(ans, t + 1);
            }
            if ans == 100050 {
                -1
            } else {
                ans
            }
        }
    }
    foo(s.as_str(), k, k, k)
}

pub fn take_characters(s: String, k: i32) -> i32 {
    if k == 0 {
        return 0;
    }

    let mut av = Vec::new();
    let mut bv = Vec::new();
    let mut cv = Vec::new();

    for (i, c) in s.chars().enumerate() {
        match c {
            'a' => {
                av.push(i);
            }
            'b' => {
                bv.push(i);
            }
            'c' => {
                cv.push(i);
            }
            _ => panic!(),
        }
    }

    let k = k as usize;

    if av.len() < k || bv.len() < k || cv.len() < k {
        -1
    } else {
        fn foo(av: &Vec<usize>, bv: &Vec<usize>, cv: &Vec<usize>, sl: usize, k: usize) -> i32 {
            let mut ans = sl
                - std::cmp::min(
                    av[av.len() - k],
                    std::cmp::min(bv[bv.len() - k], cv[cv.len() - k]),
                );

            for i in 0..av.len() {
                let l = av[i];
                let deleted_a = i + 1;
                let mut r = if deleted_a >= k {
                    sl
                } else {
                    av[av.len() - (k - deleted_a)]
                };
                let deleted_b = bv.partition_point(|x| *x < l);
                r = std::cmp::min(
                    r,
                    if deleted_b >= k {
                        sl
                    } else {
                        bv[bv.len() - (k - deleted_b)]
                    },
                );

                let deleted_c = cv.partition_point(|x| *x < l);
                r = std::cmp::min(
                    r,
                    if deleted_c >= k {
                        sl
                    } else {
                        cv[cv.len() - (k - deleted_c)]
                    },
                );
                // println!("{} {}", l, r);
                ans = std::cmp::min(ans, l + 1 + sl - r);
            }
            ans as i32
        }
        let a = foo(&av, &bv, &cv, s.len(), k);
        let b = foo(&bv, &av, &cv, s.len(), k);
        let c = foo(&cv, &av, &bv, s.len(), k);
        // println!("{} {} {}", a, b, c);
        std::cmp::min(a, std::cmp::min(b, c))
    }
}

fn main() {
    assert_eq!(take_characters("aabaaaacaabc".to_string(), 2), 8);
    assert_eq!(take_characters("a".to_string(), 1), -1);
    assert_eq!(take_characters("abc".to_string(), 1), 3);
    assert_eq!(take_characters("".to_string(), 32701), 98317);
    assert_eq!(take_characters("cbbac".to_string(), 1), 3);
}
